// validation-rh.component.ts
import { Component, OnInit } from '@angular/core';
import { DemandeService } from '../demande.service';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';
import { Router } from '@angular/router';
import { AuthService } from '../auth.service';
import jsPDF from 'jspdf';

@Component({
  selector: 'app-validation-rh',
  standalone: true, 
  imports: [CommonModule, FormsModule], 
  templateUrl: './validation-rh.html',
  styleUrls: ['./validation-rh.css']
})
export class ValidationRhComponent implements OnInit {
  demandesValidees: any[] = [];
  searchTerm: string = '';
  isLoading: boolean = false;
  errorMessage: string = '';

  // Image de background en base64 - Ã€ REMPLACER AVEC VOTRE IMAGE
  private backgroundImageBase64 = 'DATA:image/png;base64,';

  constructor(
    private demandeService: DemandeService,
    private router: Router,
    private authService: AuthService
  ) { }

  ngOnInit(): void {
    this.chargerDemandesValidees();
  }

  chargerDemandesValidees(): void {
    this.isLoading = true;
    this.errorMessage = '';
    
    this.demandeService.getDemandesValidees().subscribe({
      next: (data) => {
        this.demandesValidees = data || [];
        // Trier les demandes par date de demande dÃ©croissante (plus rÃ©cente en premier)
        this.demandesValidees.sort((a, b) => {
          const dateA = new Date(a.dateDemande);
          const dateB = new Date(b.dateDemande);
          return dateB.getTime() - dateA.getTime();
        });
        this.isLoading = false;
      },
      error: (error) => {
        console.error('Erreur lors du chargement des demandes validÃ©es:', error);
        this.demandesValidees = [];
        this.isLoading = false;
        this.errorMessage = 'Erreur lors du chargement des demandes validÃ©es';
      }
    });
  }

  get demandesFiltrees(): any[] {
    let demandesFiltrees = this.demandesValidees;
    
    if (this.searchTerm) {
      demandesFiltrees = this.demandesValidees.filter(demande =>
        demande.nomDemandeur.toLowerCase().includes(this.searchTerm.toLowerCase()) ||
        demande.prenom.toLowerCase().includes(this.searchTerm.toLowerCase()) ||
        demande.motif.toLowerCase().includes(this.searchTerm.toLowerCase())
      );
    }
    
    // Maintenir le tri par date de demande dÃ©croissante (plus rÃ©cente en premier)
    return demandesFiltrees.sort((a, b) => {
      const dateA = new Date(a.dateDemande);
      const dateB = new Date(b.dateDemande);
      return dateB.getTime() - dateA.getTime();
    });
  }

  // Export PDF avec jsPDF
  exporterPDF(demande: any): void {
    const doc = new jsPDF();
    
    // GÃ©nÃ©rer le PDF directement avec les images base64
    this.generatePDFWithBase64Images(doc, demande);
  }

  // MÃ©thode pour gÃ©nÃ©rer le PDF avec les images base64
  private generatePDFWithBase64Images(doc: any, demande: any): void {
    // Ajouter l'image de background en premier
    this.addBackgroundImage(doc);
    
    // Date en haut Ã  droite
    doc.setFont('times', 'normal');
    doc.setFontSize(11);
    const dateDoc = this.formatDate(new Date());
    doc.text(dateDoc, 180, 95, { align: 'right' });
    
    // Objet
    doc.setFont('times', 'bold');
    doc.setFontSize(12);
    doc.text('Objet : Approbation de votre demande de congÃ©', 20, 110);
    
    // Corps du texte
    doc.setFont('times', 'normal');
    doc.setFontSize(11);
    
    const civilite = demande.sexe === 'F' ? 'madame' : 'monsieur';
    let yPosition = 130;
    
    const paragraphe = [
      `Bonjour ${civilite} ${demande.nomDemandeur},`,
      '',
      `Nous vous informons que votre demande de congÃ© dÃ©posÃ©e le ${this.formatDate(demande.dateDemande)}`,
      `pour la pÃ©riode du ${this.formatDate(demande.dateDebut)} au ${this.formatDate(demande.dateFin)} a Ã©tÃ© approuvÃ©e.`,
      '',
      'Nous vous souhaitons de passer un bon congÃ© et restons Ã  votre disposition pour toute information',
      'complÃ©mentaire. Merci de vous assurer que toutes les passations de consigne ont Ã©tÃ© effectuÃ© dans',
      ' les regles de l\'art avant votre dÃ©part.',
      '',
      'Bien cordialement,',
      '',
      '',
      'Service RH',
      'ADA'
    ];
    
    paragraphe.forEach((ligne, index) => {
      if (ligne) {
        if (ligne === 'Service RH' || ligne === 'ADA') {
          doc.setFont('times', 'bold');
          doc.setFontSize(11);
        } else {
          doc.setFont('times', 'normal');
          doc.setFontSize(11);
        }
        doc.text(ligne, 20, yPosition + (index * 8));
      }
    });
    
    doc.save(`approbation-conge-${demande.nomDemandeur.replace(/\s+/g, '_')}.pdf`);
  }

  // MÃ©thode pour ajouter l'image de background en base64
  private addBackgroundImage(doc: any): void {
    if (this.backgroundImageBase64) {
      try {
        // Ajouter l'image de background directement depuis base64 pour couvrir toute la page A4
        doc.addImage(this.backgroundImageBase64, 'PNG', 0, 0, 210, 297);
        console.log('Image de background (base64) ajoutÃ©e au PDF avec succÃ¨s !');
      } catch (error) {
        console.error('Erreur avec l\'image de background base64, utilisation du fond blanc:', error);
        this.addWhiteBackground(doc);
      }
    } else {
      console.log('Image de background base64 non dÃ©finie, utilisation du fond blanc');
      this.addWhiteBackground(doc);
    }
  }

  // MÃ©thode pour ajouter un fond blanc en fallback
  private addWhiteBackground(doc: any): void {
    doc.setFillColor(255, 255, 255);
    doc.rect(0, 0, 210, 297, 'F');
  }

  // formater la pÃ©riode
  private formatDate(date: string | Date): string {
    const d = new Date(date);
    return d.toLocaleDateString('fr-FR');
  }

  // MÃ©thode pour retourner au dashboard
  retourDashboard(): void {
    this.router.navigate(['/dashboard']);
  }

  // MÃ©thode pour se dÃ©connecter
  logout(): void {
    this.authService.logout();
    this.router.navigate(['/login']);
  }
}